import React, { Component } from 'react';

import './App.css';

class App extends Component{
  constructor(props){
    super(props);
    this.state = {
      items : [],
      isLoaded: false,
    }
  }
  render() {
    return(
      <div className="App">
        Zika
      </div>
    );
  }

}

export default App;
